import React, { useState } from 'react';
import axios from 'axios';
import logo from '../Images/food.png';
import admin from '../Images/Admin.png';

const Register = () => {
    const [fullName, setFullName] = useState("");
    const [userRole, setUserRole] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [responseMessage, setResponseMessage] = useState("");
    const [isLoading, setIsLoading] = useState(false);

    const handleRegister = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post(
            "http://localhost:5293/api/Auth/register",
            
            { fullName, userRole, email, password },
            {
                headers: {
                "Content-Type": "application/json", // ระบุ Header สำหรับ JSON
                },
            }
            );
            console.log("Success:", response.data);
        } catch (error) {
            console.error("Error:", error.response?.data || error.message);
        }
    };

    return (
        <div className="login-register-container">
        <div className="logo">
            <img src={logo} alt="Logo" />
        </div>
        <div className="form-container">
            <img src={admin} className="avatar" alt="Admin Avatar" />
            <form onSubmit={handleRegister}>
            <input
                type="fullName"
                placeholder="Full Name..."
                value={fullName}
                onChange={(e) => setFullName(e.target.value)}
                required
            />
            <input
                type="userRole"
                placeholder="Role..."
                value={userRole}
                onChange={(e) => setUserRole(e.target.value)}
                required
            />
            <input
                type="email"
                placeholder="Email..."
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
            />
            <input
                type="password"
                placeholder="Password..."
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
            />
            <button type="submit" className="btn" disabled={isLoading}>
                {isLoading ? "Processing..." : "Register"}
            </button>
            </form>
            <div className="response-message" style={{ color: "red", marginTop: "10px" }}>
            {responseMessage}
            </div>
        </div>
        </div>
    );
};

export default Register;
